import React, { Component } from 'react';

export default class Header extends Component {

  render () {
    const style = { border: "1px solid blue", padding: "1rem", margin: "1rem" };
    return (
      <div style={style}>
        <h1>Hello Header!</h1>
        <div className="HeaderLinks">
          <MenuBar />
          <ul>
          <h3>Link Sign Up</h3>
          <h3>Link About</h3>
        </ul>
        </div>
      </div>
    )
  }
}
